def my_func(input1: str):
    if len(input1) < 1 or len(input1) > 100:
        return None
    unique_chars = {char: input1.count(char) for char in input1}
    max_count = max(unique_chars.values())
    candidates = [char for char, count in unique_chars.items() if count == max_count]
    return min(candidates, key=lambda char: input1.index(char))
